public class HMResourceMaster extends FormRun
{

    RecId                           organizationalUnitRecId;
    HMTreeSearching                 hmTreeSearchingObject;
    HMNumberSequenceHandler         numberSequenceHandler;
}

public void buildOrganizationalUnitTree()
{
    TreeItemIdx                     parentItemIdx;
    HMOrganizationalUnitHelper helper = new HMOrganizationalUnitHelper();

    hmTreeSearchingObject = new HMTreeSearching();
    OrganizationalUnitTree.deleteAll();

    parentItemIdx = SysFormTreeControl::addTreeItem(OrganizationalUnitTree,"@MAZ70",FormTreeAdd::Root,0,0,1);
    hmTreeSearchingObject.insertItem(parentItemIdx, "@MAZ70");

    helper.buildOUTree(OrganizationalUnitTree, parentItemIdx,0);

    OrganizationalUnitTree.expand(parentItemIdx);

}

public void close()
{
    super();
    numberSequenceHandler.deleteNewNumSeq();
}

public void init()
{
    super();
    //Initialize splitter

    this.buildOrganizationalUnitTree();

    numberSequenceHandler = new HMNumberSequenceHandler();

}

public void updateInternalExternal()
{
    if(HMResourceMaster.VendorType == HMVendorType::External)
    {
        HMResourceMaster_ds.object(fieldNum(HMResourceMaster, OpeningHours)).allowAdd(true);
        HMResourceMaster_ds.object(fieldNum(HMResourceMaster, CancellationPolicy)).allowAdd(true);
        HMResourceMaster_ds.object(fieldNum(HMResourceMaster, AppointmentTaking)).allowAdd(true);
        HMResourceMaster_ds.object(fieldNum(HMResourceMaster, Confirmation)).allowAdd(true);
        HMResourceMaster_ds.object(fieldNum(HMResourceMaster, DocumentSending)).allowAdd(true);
    }
    else
    {
        HMResourceMaster_ds.object(fieldNum(HMResourceMaster, OpeningHours)).allowAdd(false);
        HMResourceMaster_ds.object(fieldNum(HMResourceMaster, CancellationPolicy)).allowAdd(false);
        HMResourceMaster_ds.object(fieldNum(HMResourceMaster, AppointmentTaking)).allowAdd(false);
        HMResourceMaster_ds.object(fieldNum(HMResourceMaster, Confirmation)).allowAdd(false);
        HMResourceMaster_ds.object(fieldNum(HMResourceMaster, DocumentSending)).allowAdd(false);
    }
}

public void updateTabs()
{
    switch(HMResourceMaster.Type)
    {
        case HMResourceType::Vendor:
            TabPageHealthPractioners.enabled(true);
            TabPageDevices.enabled(false);
            TabPageEmployee.enabled(false);
            TabPageEmployee.fastTabExpanded(FastTabExpanded::No);
            TabPageHealthPractioners.fastTabExpanded(FastTabExpanded::Yes);
            TabPageDevices.fastTabExpanded(FastTabExpanded::No);
            TabPageSpeciality.enabled(true);
            TabPageAttributesAptitudes.enabled(true);
            TabPageResourceGroup.enabled(true);
            VendorId.mandatory(true);
            DeviceId.mandatory(false);
            PersonalNumberId.mandatory(false);
            break;
        case HMResourceType::Device:
            TabPageHealthPractioners.enabled(false);
            TabPageDevices.enabled(true);
            TabPageEmployee.enabled(false);
            TabPageSpeciality.enabled(false);
            TabPageAttributesAptitudes.enabled(false);
            TabPageResourceGroup.enabled(false);
            TabPageEmployee.fastTabExpanded(FastTabExpanded::No);
            TabPageHealthPractioners.fastTabExpanded(FastTabExpanded::No);
            TabPageDevices.fastTabExpanded(FastTabExpanded::Yes);
            VendorId.mandatory(false);
            DeviceId.mandatory(true);
            PersonalNumberId.mandatory(false);
            break;
        case HMResourceType::Employee:
            TabPageHealthPractioners.enabled(false);
            TabPageDevices.enabled(false);
            TabPageEmployee.enabled(true);
            TabPageSpeciality.enabled(true);
            TabPageAttributesAptitudes.enabled(true);
            TabPageResourceGroup.enabled(true);
            TabPageEmployee.fastTabExpanded(FastTabExpanded::Yes);
            TabPageHealthPractioners.fastTabExpanded(FastTabExpanded::No);
            TabPageDevices.fastTabExpanded(FastTabExpanded::No);
            VendorId.mandatory(false);
            DeviceId.mandatory(false);
            PersonalNumberId.mandatory(true);
            break;
        default:
            TabPageHealthPractioners.enabled(false);
            TabPageDevices.enabled(false);
            TabPageEmployee.enabled(false);
            TabPageEmployee.fastTabExpanded(FastTabExpanded::No);
            TabPageHealthPractioners.fastTabExpanded(FastTabExpanded::No);
            TabPageDevices.fastTabExpanded(FastTabExpanded::No);
            VendorId.mandatory(false);
            DeviceId.mandatory(false);
            PersonalNumberId.mandatory(false);
            break;
    }
}

