public void create(boolean _append = false)
{
    super(_append);

    if (!HMResourceMaster.Code)
    {
        HMResourceMaster.Code = numberSequenceHandler.generateNumberSequenceDataArea(extendedTypeNum(HMResourceMasterCode));
    }
}

public int active()
{
    int ret;

    ret = super();

    element.updateTabs();
    element.updateInternalExternal();

    return ret;
}

public void modified()
{
    super();

    element.updateTabs();
    HMResourceMaster.RefRecId = 0;
}

public Common lookupReference(FormReferenceControl _formReferenceControl)
{
    Common ret;
    SysReferenceTableLookup sysReferenceTableLookup;

    QueryBuildDataSource    queryBuildDataSource;
    Query                   query = new Query();
    sysReferenceTableLookup = SysReferenceTableLookup::newParameters(tableNum(HMResourceAptitudeAttribute), _formReferenceControl, true);

    queryBuildDataSource = query.addDataSource(tableNum(HMResourceAptitudeAttribute));
    queryBuildDataSource.addGroupByField(fieldNum(HMResourceAptitudeAttribute, Code));
    queryBuildDataSource.addGroupByField(fieldNum(HMResourceAptitudeAttribute, RecId));
    queryBuildDataSource.addGroupByField(fieldNum(HMResourceAptitudeAttribute, Description));

    queryBuildDataSource = queryBuildDataSource.addDataSource(tableNum(HMSpecialityAptitudesAttributes));
    queryBuildDataSource.relations(true);

    queryBuildDataSource = queryBuildDataSource.addDataSource(tableNum(HMResourceMasterSpeciality));
    queryBuildDataSource.addLink(fieldNum(HMSpecialityAptitudesAttributes, HMSpecialtyCode), fieldNum(HMResourceMasterSpeciality, HMSpecialtyCode));
    queryBuildDataSource.addRange(fieldNum(HMResourceMasterSpeciality, HMResource)).value(SysQuery::value(HMResourceMaster.RecId));

    sysReferenceTableLookup.addLookupfield(fieldNum(HMResourceAptitudeAttribute, Code));
    sysReferenceTableLookup.addLookupfield(fieldNum(HMResourceAptitudeAttribute, Description));
    sysReferenceTableLookup.parmQuery(query);

    ret = sysReferenceTableLookup.performFormLookup();


    return ret;
}

