void clicked()
{
    RecId   workerRecId= 0;
    super();
    if(HMResourceMaster.type == HMResourceType::Employee)
    {
        workerRecId = HMResourceMaster.RefRecId;
    }
    if(HMResourceMasterHelper::insertResourceOrganizationalUnit(HMResourceMaster.RecId, organizationalUnitRecId,workerRecId))
    {
        HMResourceOrganizationalUnit_DS.executeQuery();
    }
}

public void selectionChanged(FormTreeItem _OldItem, FormTreeItem _NewItem, FormTreeSelect _how)
{
    FormTreeItem                selectedTreeItem;
    String10                    data;

    super(_OldItem, _NewItem, _how);

    selectedTreeItem = OrganizationalUnitTree.getItem(OrganizationalUnitTree.getSelection());
    data = selectedTreeItem.data();
    organizationalUnitRecId=str2int64(data);

    SelectButton.enabled(HMOrganizationalUnitHelper::isOUNotDept(organizationalUnitRecId));
}
